import strawberry from "../../../assets/strawberry_1.jpg";
import milk from "../../../assets/milk_1.jpg";
import pomegranate from "../../../assets/pomegranate_1.jpg";
import orange from "../../../assets/orange_1.jpg";
import classes from "./Images.module.css";

import { Fragment } from "react";
import Card from "../../UI/Card";

const Images = (props) => {
  return (
    <Fragment>
      <img src={strawberry} alt="strawberry" className={classes.image}></img>
      <div className={classes.overlay}>
        <div className={classes.text}>Hello World</div>
      </div>

      <img src={milk} alt="milk" className={classes.image}></img>
      <div className={classes.overlay}>
        <div className={classes.text}>Hello World</div>
      </div>

      <img src={pomegranate} alt="pomegranate" className={classes.image}></img>
      <div className={classes.overlay}>
        <div className={classes.text}>Hello World</div>
      </div>

      <img src={orange} alt="orange" className={classes.image}></img>
      <div className={classes.overlay}>
        <div className={classes.text}>Hello World</div>
      </div>
    </Fragment>
  );
};

export default Images;
